import "./Contactus.css"
const Contactus = () => {
return(
    <form className="contact">
    <div className="form-group input ">
      <input type="Name" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter Your Name"/>
    </div>
    <div className="form-group">
      <input type="Email" className="form-control" id="exampleInputPassword1" placeholder="Enter your Email"/>
    </div>
    <div className="form-group">
      <input type="mobile" className="form-control" id="exampleInputPassword1" placeholder="Enter your contact no."/>
    </div>
   
    <button type="submit" className="btn btn-primary">Submit</button>
  </form>
);

}
export default Contactus;
